const ProductSale = (prop) => {
  return (
    <div className={prop.class}>
      <div className="product-image">
        <img src={prop.item.src} alt={prop.alt}/>
      </div>
      <span className="product-price">{prop.item.price}</span>
    </div>
  );
};

export default ProductSale;
